// CardDetailsContract.sol
// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

contract CardDetailsContract {
    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the contract owner can call this function.");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    struct Card {
        address owner;
        string cardID;
        string cardHolderName;
        string cardNumber;
        string cvv;
        string issueDate;
        string expiryDate;
        string bankName;
        string cardHolderCnic;
        string cardType;
        bool isCardFreeze;
        string ownedBy;
        uint256 priorityNumber;
        bool exists;
    }
    
    struct CardParams {
        string cardNumber;
        string cardHolderName;
        string cvv;
        string issueDate;
        string expiryDate;
        string bankName;
        string cardHolderCnic;
        string cardType;
        bool isCardFreeze;
        string ownedBy;
        uint256 priorityNumber;
    }

    mapping(string => Card) private cardDetails;
    
    function storeCardDetails(string memory _cardID, CardParams memory _params) external onlyOwner returns (Card memory) {
        require(bytes(_cardID).length > 0, "Card ID must not be empty.");
        require(!cardDetails[_cardID].exists, "Card details already exist for this card ID.");

        cardDetails[_cardID] = Card(
            msg.sender,
            _cardID,
            _params.cardHolderName,
            _params.cardNumber,
            _params.cvv,
            _params.issueDate,
            _params.expiryDate,
            _params.bankName,
            _params.cardHolderCnic,
            _params.cardType,
            _params.isCardFreeze,
            _params.ownedBy,
            _params.priorityNumber,
            true
        );

        return cardDetails[_cardID];
    }

    function deleteCard(string memory _cardID) external onlyOwner returns (bool deleted) {
        require(cardDetails[_cardID].exists, "No card details found for this card ID.");
        delete cardDetails[_cardID];
        return true;
    }

    function retrieveCardDetails(string memory _cardID) external onlyOwner view returns (Card memory) {
        require(cardDetails[_cardID].exists, "No card details found for this card ID.");
        return cardDetails[_cardID];
    }

    // push is not available in memory variables
    function getAllCardDetails(bytes32[] memory _cardIDs) external onlyOwner view returns (Card[] memory) {
        // Create a dynamic array to store found cards
        Card[] memory allCards = new Card[](0); // Initialize an empty array
        
        // Iterate through the provided card numbers
        for (uint i = 0; i < _cardIDs.length; i++) {
            string memory cardID = bytes32ToString(_cardIDs[i]);
            
            // Check if the card exists in the mapping
            if (cardDetails[cardID].exists) {
                // If the card exists, resize the array and add the card to it
                Card[] memory newArray = new Card[](allCards.length + 1);
                for (uint j = 0; j < allCards.length; j++) {
                    newArray[j] = allCards[j];
                }
                newArray[allCards.length] = cardDetails[cardID];
                allCards = newArray;
            }
        }
        
        // Return the dynamic array containing only the found cards
        return allCards;
    }

    // Utility function to convert bytes32 to string
    function bytes32ToString(bytes32 _bytes32) internal pure returns (string memory) {
        uint8 i = 0;
        while(i < 32 && _bytes32[i] != 0) {
            i++;
        }
        bytes memory bytesArray = new bytes(i);
        for (i = 0; i < 32 && _bytes32[i] != 0; i++) {
            bytesArray[i] = _bytes32[i];
        }
        return string(bytesArray);
    }
}

